import React from 'react';
import Navbar from "./components/navbar"
import Footer from "./components/footer"


import 'bulma/css/bulma.css'

function App() {
  return (
    <div className="App">
      <Navbar />
      <div style={{ height: 400 }}></div>
      <Footer/>

    </div>
  );
}

export default App;
